import "./App.css";
import exampleresponse from "./exampleresponse.json"

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Video Recommendation</h1>
      </header>
      {exampleresponse.map(video=>{
        return (<div>
               <h1>{video.title}</h1>
          </div>)
      })}
    </div>
  );
}

export default App;
